object Solution {
    def canTraverseAllPairs(nums: Array[Int]): Boolean = {
        val maxVal = 100000
        val parent = Array.tabulate(maxVal + 1)(identity)

        def find(x: Int): Int = if (parent(x) == x) x else {
            parent(x) = find(parent(x))
            parent(x)
        }

        def union(x: Int, y: Int): Unit = {
            val rootX = find(x)
            val rootY = find(y)
            if (rootX != rootY) {
                parent(rootX) = rootY
            }
        }

        for (num <- nums.distinct) {
            for (factor <- 2 to math.sqrt(num).toInt if num % factor == 0) {
                union(num, factor)
                union(num, num / factor)
            }
        }

        val root = find(nums(0))
        nums.forall(num => find(num) == root || find(find(num)) == root)
    }
}
